import axios from 'axios'

export function getCategoryList () {
  return axios.get('https://opentdb.com/api_category.php')
    .then(res => res.data.trivia_categories)
}

export function getQuestions (country) {
    return axios.get(`https://api.covid19api.com/country/${country}/status/confirmed?from=2020-03-01T00:00:00Z&to=2020-04-01T00:00:00Z`)
      .then(res => res.data)
  }
